    <script>
        var i = -452;
        var no = 1;
        setInterval(function () {
            var unit = -906;
            if(i <= (unit*4.5)){
                i = -452;
                no = 1;
                $(".auto_slide_container").css({"margin-left":"-452px"});
                $(".auto_slide_container .slide_item").removeClass("active");
                $(".auto_slide_container .slide_item:nth-of-type(1)").addClass("active");
            }else {
                i += unit;
                no += 1;
                $(".auto_slide_container").css({"margin-left":i+"px"});
                $(".auto_slide_container .slide_item").removeClass("active");
                $(".auto_slide_container .slide_item:nth-of-type("+no+")").addClass("active");
            }

        },2000);

        var mission = $(".brand_mission").offset().top - 450;
        $(".about_dk").on('mousewheel', function (e) {
            var wheelDelta = e.originalEvent.wheelDelta;
            if($(".case_video_wrap").attr("data-case-status") == "right"){
                if(wheelDelta < 0){
                    setTimeout(function () {
                        $(".case_video_wrap").attr("data-case-status", "full");
                    },200);
                    $(".case-head-content div").attr("data-overflow-state", "inactive");
                }
            } else if($(".case_video_wrap").attr("data-case-status") == "full") {
                if (wheelDelta < 0) {
                    setTimeout(function () {
                        $(".case_video_wrap").attr("data-case-status", "left");
                    },200);
                    $(".right_pj_section").attr("data-content-status", "active");
                    setTimeout(function () {
                        $(".about_dk").addClass("vertical")
                    },1000);
                }else {
                    setTimeout(function () {
                        $(".case_video_wrap").attr("data-case-status", "right");
                        $(".right_pj_section").attr("data-content-status", "inactive");
                        $(".case-head-content div").attr("data-overflow-state", "active");
                    },200);
                }
            } else if ($(".case_video_wrap").attr("data-case-status") == "left") {
                var scrollT = $(this).scrollTop();
                if (scrollT <= 0) {
                    if (wheelDelta >= 0) {
                        setTimeout(function () {
                            $(".case_video_wrap").attr("data-case-status", "full");
                            $(".right_pj_section").attr("data-content-status", "inactive");
                        },200);
                        $(".about_dk").removeClass("vertical")
                    }
                }else if(scrollT > 0){
                    $(".right_pj_section").attr("data-content-status", "full");

                    /*text effect*/
                    if (scrollT > mission) {
                        $(".texteffect").addClass("active");
                    }

                    $('.fadeInUp').each( function(i){
                        var header = $(".header_wra").outerHeight();
                        var bottom_of_element = $(this).offset().top + $(this).outerHeight() - (header * 3.8);
                        var bottom_of_window = $(window).scrollTop() + $(window).height();
                        if( bottom_of_window > bottom_of_element ){
                          $(this).addClass("loaded");
                        }
                    });
                    $('.fadeInUpFast').each( function(i){
                        var header = $(".header_wra").outerHeight();
                        var bottom_of_element = $(this).offset().top + $(this).outerHeight() - (header * 7);
                        var bottom_of_window = $(window).scrollTop() + $(window).height();
                        if( bottom_of_window > bottom_of_element ){
                          $(this).addClass("loaded");
                        }
                    });

                }
            }
        });
/*

        $(window).on("scroll",function () {
            var scrollT = $(window).scrollTop();

        });
*/


    </script>
